import logo from "./logo.svg";
import "./App.css";
import RolezandoList from "./pages/RolezandoList/RolezandoList";

function App() {
  const getData = (url) => {
    const data = fetch(url)
      .then((res) => res.text())
      .then((text) => JSON.parse(text.substr(47).slice(0, -2)));

    return data;
  };

  const data = getData(
    "https://docs.google.com/spreadsheets/d/1CaEwqnqAHElnM_sOKOn9m92XWqnSCv_XnHQlncy5Vl4/gviz/tq?tqx=out:json"
  );

  return (
    <div className="App">
      <RolezandoList list={data} />
    </div>
  );
}

export default App;
